INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', NULL, '\n<div class="page-title"><h1>Whoops, our bad...</h1></div>\n<dl>\n    <dt>The page you requested was not found, and we have a fine guess why.</dt>\n    <dd>\n        <ul class="disc">\n            <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n            <li>If you clicked on a link to get here, the link is outdated.</li>\n        </ul>\n    </dd>\n</dl>\n<dl>\n    <dt>What can you do?</dt>\n    <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\n    <dd>\n        <ul class="disc">\n            <li><a href="#" onclick="history.go(-1); return false;">Go back</a> to the previous page.</li>\n            <li>Use the search bar at the top of the page to search for your products.</li>\n            <li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a>\n            <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li>\n        </ul>\n    </dd>\n</dl>\n', '2015-11-10 15:29:30', '2015-11-10 15:29:30', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'CreativeBazaarBD', 'one_column', NULL, NULL, 'home', NULL, '<div id="slider">\r\n<div id="carousel-example-generic" class="carousel slide" data-ride="carousel"><!-- Wrapper for slides -->\r\n<div class="carousel-inner" role="listbox">\r\n<div class="item active"><img alt="" src="{{skin url=''images/slide-1.jpg''}}" />\r\n<div class="carousel-caption">&nbsp;</div>\r\n</div>\r\n<div class="item"><img alt="" src="{{skin url=''images/slide-2.jpg''}}" />\r\n<div class="carousel-caption">&nbsp;</div>\r\n</div>\r\n</div>\r\n<!-- Controls --> <a class="left carousel-control" role="button" href="#carousel-example-generic" data-slide="prev"> <span class="sr-only">Previous</span> </a> <a class="right carousel-control" role="button" href="#carousel-example-generic" data-slide="next"> <span class="sr-only">Next</span> </a></div>\r\n</div>\r\n<!-- end slider section -->\r\n\r\n<div class="home-cat-product">\r\n<div class="cat-list-title">Mens</div>\r\n{{block type="catalog/product_list" category_id="3" template="catalog/product/cat_product_list.phtml"}}\r\n</div>\r\n\r\n<!-- end Mens section -->\r\n\r\n<div class="home-cat-product">\r\n<div class="cat-list-title">Womens</div>\r\n{{block type="catalog/product_list" category_id="9" template="catalog/product/cat_product_list.phtml"}}\r\n</div>\r\n\r\n<!-- end Womens section -->\r\n\r\n<div class="home-cat-product">\r\n<div class="cat-list-title">Kids</div>\r\n{{block type="catalog/product_list" category_id="10" template="catalog/product/cat_product_list.phtml"}}\r\n</div>\r\n\r\n<!-- end Kids section -->\r\n<div class="home-cat-product">\r\n<div class="cat-list-title">Birthday Tools</div>\r\n{{block type="catalog/product_list" category_id="11" template="catalog/product/cat_product_list.phtml"}}\r\n</div>\r\n\r\n<!-- end Birthday Tools section -->\r\n<div class="home-cat-product">\r\n<div class="cat-list-title">Office Stationary</div>\r\n{{block type="catalog/product_list" category_id="12" template="catalog/product/cat_product_list.phtml"}}\r\n</div>\r\n\r\n<!-- end Office Stationary section -->\r\n<div class="home-cat-product">\r\n<div class="cat-list-title">Gift Items</div>\r\n{{block type="catalog/product_list" category_id="13" template="catalog/product/cat_product_list.phtml"}}\r\n</div>\r\n\r\n<!-- end Gift Items section -->', '2015-11-10 15:29:30', '2015-11-12 17:12:19', 1, 0, '<!--<reference name="content">\r\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name="right">\r\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\r\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->', NULL, NULL, NULL, NULL, NULL),
